  [],\n\t\"revision_timestamp\": \"2016-07-27T22:40:58.162200\",\n\t\"name\": \"ouray-national-wildlife-refuge-narrative-report-calendar-year-1988\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ouray
  National Wildife Refuge outlines Refuge accomplishments during the 1988 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the management plan. Refuge administration is outlined; information about personnel,
  funding, safety, and technical assistance is given. Habitat management is also covered;
  subjects include wetlands, forests, croplands, grasslands, fire management, pest
  control, and water rights. The wildlife section of the report discusses wildlife
  diversity, endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, fisheries resources, scientific collections,
  and animal control. The public uses of the Refuge described in this report include
  interpretive programs, hunting, fishing, and law enforcement. The equipment and
  facilities section of the report provides information about new construction, rehabilitation,
  major maintenance, equipment replacement, and communication systems, computers systems.
  Cooperative programs and items of interest are provided at the end.\",\n\t\"license_title\":
